import React, { Component } from 'react'

export default class Dialogue extends Component {
    render() {
        return (
            <Dialog onClose={this.handleClose} aria-labelledby="customized-dialog-title" open={this.state.showState}>
                <DialogContent dividers>
                    <Typography variant="h2" style={{ fontWeight: '600', textAlign: 'center' }} gutterBottom>
                        BINGO!
                    </Typography>
                    <Typography gutterBottom>
                        You have found all the dog squares!
                    </Typography>
                </DialogContent>
                <Button variant="primary" onClick={this.handleClose}>Ruff!</Button>
            </Dialog>
        )
    }
}
